      /* addressInfoIpv6 */
      case 2:
         RTXCTXTPUSHELEMNAME (pctxt, "addressInfoIpv6");

         RTDIAG_NEWBITFIELD (pctxt, "OCTET STRING");

         ret = rtxDecBitsToByteArray (pctxt, pvalue->addressInfo.u.addressInfoIpv6, 8, 64);

         RTDIAG_SETBITFLDCOUNT (pctxt);

         RTXCTXTPOPELEMNAME (pctxt);
         break;

      /* addressInfoIpv4v6 */
      case 3:
         RTXCTXTPUSHELEMNAME (pctxt, "addressInfoIpv4v6");

         /* decode ipv6 */

         RTXCTXTPUSHELEMNAME (pctxt, "ipv6");

         RTDIAG_NEWBITFIELD (pctxt, "OCTET STRING");

         ret = rtxDecBitsToByteArray (pctxt, pvalue->addressInfo.u.addressInfoIpv4v6.ipv6, 8, 64);

         RTDIAG_SETBITFLDCOUNT (pctxt);

