         RTXCTXTPUSHELEMNAME (pctxt, "absent");

         RTXCTXTPOPELEMNAME (pctxt);
         break;

      /* present */
      case 1:
         RTXCTXTPUSHELEMNAME (pctxt, "present");

         RTDIAG_NEWBITFIELD (pctxt, "OCTET STRING");

         ret = rtxDecBitsToByteArray (pctxt, pvalue->smfIp6Addr.u.present, 8, 64);

